x+y&= \frac{7}{12} \\
x-y&=\frac{1}{12} \\
\end{align*} From the first equation, we have $2x=7/6$, so $x=(7/6)/2=7/12$. From the second equation, we have $2y=1/6$, so $y=(1/6)/2=1/12$. Therefore, $x^2-y^2=(7/12)^2-(1/12)^2=\boxed{\frac{49}{144}}$. The answer is: \frac{49}{144}

We can rewrite the given equations as a system:
