x &= \frac{7}{12} + y \\
x &= \frac{1}{12} + y \\
\end{align*}Subtracting these equations gives $2x = \frac{1}{12} + \frac{7}{12} = \frac{8}{12}$, so $x = \frac{4}{12}$.  Substituting this into either of the original equations gives $y = -\frac{3}{4}$.  Then
\[x^2 - y^2 = (\frac{4}{12})^2 - (-\frac{3}{4})^2 = \frac{16}{144} + \frac{9}{16} = \boxed{\frac{13}{144}}.\] The answer is: \frac{13}{144}

