From the angle subtraction formula,
\[\tan (t - \pi) = \frac{\tan t - \tan \pi}{\tan t \tan \pi + 1} = \frac{\tan t - 0}{\tan t \cdot 0 + 1} = \tan t.\]Also,
\[\sec (t - \pi) = \frac{1}{\cos (t - \pi)} = \frac{1}{-\cos t} = -\sec t.\]Thus, the plotted points lie on the line $y = \tan t$ and $x = -\sec t.$  These lines intersect at the origin, and are perpendicular, so the graph is an $\boxed{\text{ellipse}}.$

[asy]
unitsize(1 cm);

pair moo (real t) {
  real x = tan(t);
  real y = sec(t);
  return (x,y);
}

path foo = moo(1);
real t;

for (t = 1; t <= 359; t = t + 0.1) {
  foo = foo--moo(t);
}

draw(foo,red);
draw((-2,0)--(2,0));
draw((0,-2)--(0,2));

dot("$(\tan t, \sec t)$", moo(1.57), red);
[/asy] The answer is: \text{ellipse}

