Let the three sides of the box be $x$, $y$, and $z$ inches.  We have the equations \begin{align*}
xy&=24\\
xz&=16\\
yz&=6
\end{align*} From the equations, we can see that $x=\frac{24}{y}, z=\frac{16}{x}, y=\frac{6}{z}$.  Substituting into the equation $xyz=V$, the volume of the box, we have \begin{align*}
V&=xyz\\
&=\left(\frac{24}{y}\right)\left(\frac{16}{x}\right)\left(\frac{6}{z}\right)\\
&=24\cdot 16\cdot 6\\
&=\boxed{2304}
\end{align*} The answer is: 2304

