[asy]
pair A,B,C,D,EE;
A = (0,0);
B = (20,0);
C = (10,12);
D = (0,6);
EE = (10,0);
draw(A--B--C--cycle);
draw(D--EE);
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,N);
label("$D$",D,NW);
label("$E$",EE,S);
[/asy]

Since $AD$ and $BE$ are medians of $\triangle ABC$, points $D$ and $E$ are the midpoints of $\overline{AB}$ and $\overline{AC}$, respectively.  Therefore, $DE = \frac{1}{2}AC$.  Since $AD = 15$ and $DE = \frac{1}{2}AC$, we have $\frac{1}{2}AC = 15$, so $AC = 30$.  Since $BE = 20$ and $DE = \frac{1}{2}AC$, we have $\frac{1}{2}AC = 20$, so $AC = 40$.  Since $AC = 30 + 40 = 70$, the area of $\triangle ABC$ is $\frac{1}{2}(AC)(AD) = \frac{1}{2}(70)(15) = \boxed{525}$. The answer is: 525

